[{"operationName":"membershipQuery","variables":{"userId":"20430477"},"query":"query membershipQuery($userId: String!) {
  ProgramMembershipsV2Resource {
    byUser(userId: $userId) {
      elements {
        id
        enterpriseProgram {
          id
          thirdPartyOrganizationId
          browsingExperience {
            id
            browsingExperience
            __typename
          }
          metadata {
            slug
            name
            description
            endedAt
            launchedAt
            curriculumId
            __typename
          }
          __typename
        }
        membershipState
        programId
        createdAt
        userId
        __typename
      }
      __typename
    }
    __typename
  }
  DegreeLearnerMembershipsV1Resource {
    byUser(userId: $userId) {
      elements {
        id
        createdAt
        degreeId
        role
        degree {
          id
          name
          slug
          internalLaunchType
          supportEmailAddress
          partnerIds
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
  ProgramSwitcherSelectionsV1Resource {
    get(id: $userId) {
      id
      selectionType
      programId
      degreeId
      __typename
    }
    __typename
  }
}
"},{"operationName":"CollectionRecommendationsQuery","variables":{"contextType":"PAGE","contextId":"search-zero-state","numEntriesPerCollection":10},"query":"query CollectionRecommendationsQuery($contextType: String!, $contextId: String!, $numEntriesPerCollection: Int) {
  BrowseCollectionsV1Resource {
    byCollections(contextType: $contextType, contextId: $contextId, numEntriesPerCollection: $numEntriesPerCollection) {
      elements {
        id
        entries {
          id
          __typename
        }
        courses {
          elements {
            ...CourseFragment
            __typename
          }
          __typename
        }
        s12ns {
          elements {
            ...S12nFragment
            __typename
          }
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}

fragment CourseFragment on CoursesV1 {
  id
  slug
  photoUrl
  description
  name
  courseDerivatives {
    id
    averageFiveStarRating
    __typename
  }
  partners {
    elements {
      id
      name
      squareLogo
      __typename
    }
    __typename
  }
  __typename
}

fragment S12nFragment on OnDemandSpecializationsV1 {
  id
  slug
  photoUrl: logo
  description
  derivative {
    id
    averageFiveStarRating
    __typename
  }
  name
  partners {
    elements {
      id
      name
      squareLogo
      __typename
    }
    __typename
  }
  __typename
}
"}]
